import React from 'react'

const Login = () => {
    const handleSubmit= async(e)=>{
        e.preventDefault();
       
         //API CALL
            const response = await fetch("http://localhost:5000/api/auth/login", {
              method: "POST",
              headers: {
                "Content-Type": "application/json",
                
              }
            });
            const json = await response.json()
            console.log(json);
    }
  return (
    <div>
     <form onSubmit={handleSubmit}>
  <div className="mb-3">
    <label htmlhtmlFor="email" className="form-label">Email address</label>
    <input type="email" className="form-control" id="email" name ="email" aria-describedby="emailHelp"/>
    <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div className="mb-3">
    <label htmlhtmlFor="password" className="form-label">Password</label>
    <input type="password" className="form-control"name="password" id="password"/>
  </div>
  <div className="mb-3 form-check">
    <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
    <label className="form-check-label" htmlhtmlFor="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" className="btn btn-primary">Submit</button>
</form>
    </div>
  )
}

export default Login
